import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import reportWebVitals from "./reportWebVitals";

//Все данные должны быть тут:
/////////////////////////////

let postData = [
  {
    names: "Danny",
    id: 0,
    message: "Hi, bird, how are you?!",
    likeCount: "15",
  },
  { names: "Danny", id: 1, message: "Lets fire", likeCount: "10" },
  { names: "Danny", id: 2, message: "U smell like sheep", likeCount: "7" },
  { names: "Danny", id: 3, message: "Hi bro", likeCount: "2" },
];

let dialogsData = [
  { id: 0, name: "Jimmy" },
  { id: 1, name: "Bobby" },
  { id: 2, name: "Tommy" },
  { id: 3, name: "Katrin" },
  { id: 4, name: "Victoria" },
];

let messagesData = [
  { id: 0, text: "HI!" },
  { id: 1, text: "nice" },
  { id: 2, text: "good" },
  { id: 3, text: "bye" },
  { id: 4, text: "lets start" },
];

ReactDOM.render(
  <React.StrictMode>
    <App postData={postData} />
  </React.StrictMode>,
  document.getElementById("root")
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
